import React from 'react'
import $ from 'jquery'

const FileName = () => {
  $(function(){
    // bind change event to select
    $('#dynamic_select').on('change', function () {
        var url = $(this).val(); // get selected value
        if (url) { // require a URL
            window.location = url; // redirect
        }
        return false;
    });
  });
  return (
    <div>
      <select id="dynamic_select">
       <option value="" selected>Pick a Website</option>
      <option value="http://hosters.pk/clientarea" target="_top">Google</option>
      <option value="http://hosters.pk/blog" target="_top">YouTube</option>
      <option value="https://hosters.pk/clientarea/index.php/store/hdd-shared-hosting/basic-plan?billingcycle=annually" >GuruStop.NET</option>
</select>
    </div>
  )
}

export default FileName
